import React from 'react';
import PlayerForm from './PlayerForm';
import PlayerList from './PlayerList';

class PlayerManager extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            players: []
        }
    }

    
    onSave() {
        console.log('onSave PlayerForm Component');
    }


    render() {
        return (<>
            <PlayerForm />
            <PlayerList />
        </>)
    }
}

export default PlayerManager;
